defs.script:
function strategyShowItem(item) {
    var elem = document.querySelector("#"+item);
    var display = elem.getAttribute("visibility");
    if("hidden" === display) {
        elem.setAttribute("visibility", "")
    } else {
        elem.setAttribute("visibility", "hidden")
    }
}

